import React from 'react';
import { useLocation } from 'react-router-dom';

const Home = () => {
    // useLocation hook'u ile route state'inden veriyi alıyoruz
    const { state } = useLocation();
    // userData burada state objesi içinde
    const userData = state?.user;

    return (
        <div>
            <h1>Welcome to Home Page</h1>
            {/* userData'i kullanarak istediğiniz işlemi yapabilirsiniz */}
            {userData && (
                <div>
                    <p>User Name: {userData.User}</p>
                    <p>User Email: {userData.email}</p>
                    {/* userData'de diğer bilgileri de gösterebilirsiniz */}
                </div>
            )}
        </div>
    );
};

export default Home;
